import React from "react";
import axios from "axios";

function User() {
  const [post, setPost] = React.useState(null);

  React.useEffect(() => {
    axios.get(`${process.env.REACT_APP_API_URL}/tables`).then((response) => {
      setPost(response.data);
    });
  });

  return (
    <div>
      <p>Test</p>
    </div>
  );
}

export default User;
